int count_vote(char votes[100][6], char vote, int size) {
    int n = 0;
    for (int k = 0; k < size; k++) {
        if (strchr(votes[k], vote) != NULL) {
            n += 1;
        };
    } 
    return n;
}

int main() {
    char votes[100][6];
    int n, size = read_votes(votes);
          
    for (int i = 0; i < 5; i++) {
        n = count_vote(votes, 'a' + i, size);
        printf("%c: %d\n", 'a' + i, n);
    }
    printf("votos: %d\n", size);
}

