void print_votes(char votes[100][6], int size, char a, char b) {
    int nA = 0, nB = 0;
    
    for (int i=0; i < size; i++) {
        for (int k = 0; k < 5; k++) {
            if (votes[i][k] == a) {
                nA++;
                break;
            }
            else if (votes[i][k] == b) {
                nB++;
                break;
            }
        }
    }
    printf("%d x %d\n", nA, nB);
}


