int sequencia(int n){
  int atual, i;
  printf("seq:");
  for (i = 1; i <= n; i++){
    atual = i;
    printf(" %d", i);
    atual-=2;
    while (atual >= 1){
      printf(" %d", atual);
      atual-=2;
    }
  }
  printf("\n");
}

